import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Button, TextField, Divider, Card, CardContent, Box } from '@material-ui/core';
import openSocket from 'socket.io-client';

const socket = openSocket('http://localhost:5000');

const useStyles = makeStyles((theme) => ({
	root: {
		padding: theme.spacing(1),
	},
	padded: {
		margin: theme.spacing(1),
	},
}));

function App() {
	const classes = useStyles();

	return (
		<Box display='flex' flexDirection='column' alignItems='center'>
			<Box m={3}>
				<form noValidate autoComplete="off">
					<TextField id="name" label="Name" variant="outlined"/>
				</form>
			</Box>

			<Box display='flex' flexDirection='row'>
				<Box alignSelf='center'>
					<Button variant='contained' color='primary'>Create Game</Button>
				</Box>
				<Box mx={3}>
					<Divider orientation='vertical'/>
				</Box>
				<Box display='flex' flexDirection='column' alignSelf='center' my={3}>
					<form noValidate autoComplete="off">
						<TextField id="gameCode" label="Game Code" variant="outlined"/>
					</form>
					<Button variant='contained' color='primary' className={classes.padded}>Join Game</Button>
				</Box>
			</Box>
		</Box>
	);
}

export default App;
